import React from "react";
import "./achievements.css";
import achievementsBanner from '../../assets/banners/Banner 6.jpg';

const Achievements = () => {
    return (
        <div className="achievements-container">
            <div className="achievements-banner">
                <h1>Logros y reconocimientos</h1>
                <p>Descubre nuestras destacadas contribuciones y logros.</p>
            </div>

            <div className="section white-section">
                <p>Contenido de la sección blanca.</p>
            </div>

            <div className="section photo-section">
                <p>Texto descriptivo para la imagen</p>
            </div>

            <div className="section banner-section">
                <h2>Título del Banner</h2>
                <p>Descripción o texto adicional para el banner</p>
            </div>
        </div>
    );
}

export default Achievements;
